EventDispatcher.description:
EventDispatcher provides methods for managing queues of event listeners and dispatching events.

You can either extend EventDispatcher or mix its methods into an existing prototype or instance by using the
EventDispatcher {{#crossLink "EventDispatcher/initialize"}}{{/crossLink}} method.

Together with the CreateJS Event class, EventDispatcher provides an extended event model that is based on the
DOM Level 2 event model, including addEventListener, removeEventListener, and dispatchEvent. It supports
bubbling / capture, preventDefault, stopPropagation, stopImmediatePropagation, and handleEvent.

EventDispatcher also exposes a {{#crossLink "EventDispatcher/on"}}{{/crossLink}} method, which makes it easier
to create scoped listeners, listeners that only run once, and listeners with associated arbitrary data. The 
{{#crossLink "EventDispatcher/off"}}{{/crossLink}} method is merely an alias to
{{#crossLink "EventDispatcher/removeEventListener"}}{{/crossLink}}.

Another addition to the DOM Level 2 model is the {{#crossLink "EventDispatcher/removeAllEventListeners"}}{{/crossLink}}
method, which can be used to listeners for all events, or listeners for a specific event. The Event object also 
includes a {{#crossLink "Event/remove"}}{{/crossLink}} method which removes the active listener.

<h4>Example</h4>
Add EventDispatcher capabilities to the "MyClass" class.

     EventDispatcher.initialize(MyClass.prototype);

Add an event (see {{#crossLink "EventDispatcher/addEventListener"}}{{/crossLink}}).

     instance.addEventListener("eventName", handlerMethod);
     function handlerMethod(event) {
         console.log(event.target + " Was Clicked");
     }

<b>Maintaining proper scope</b><br />
Scope (ie. "this") can be be a challenge with events. Using the {{#crossLink "EventDispatcher/on"}}{{/crossLink}}
method to subscribe to events simplifies this.

     instance.addEventListener("click", function(event) {
         console.log(instance == this); // false, scope is ambiguous.
     });

     instance.on("click", function(event) {
         console.log(instance == this); // true, "on" uses dispatcher scope by default.
     });

If you want to use addEventListener instead, you may want to use function.bind() or a similar proxy to manage
scope.

<b>Browser support</b>
The event model in CreateJS can be used separately from the suite in any project, however the inheritance model
requires modern browsers (IE9+).

Ticker.description:
The Ticker provides a centralized tick or heartbeat broadcast at a set interval. Listeners can subscribe to the tick
event to be notified when a set time interval has elapsed.

Note that the interval that the tick event is called is a target interval, and may be broadcast at a slower interval
when under high CPU load. The Ticker class uses a static interface (ex. `Ticker.framerate = 30;`) and
can not be instantiated.

<h4>Example</h4>

     createjs.Ticker.addEventListener("tick", handleTick);
     function handleTick(event) {
         // Actions carried out each tick (aka frame)
         if (!event.paused) {
             // Actions carried out when the Ticker is not paused.
         }
     }

Point.description:
Represents a point on a 2 dimensional x / y coordinate system.

<h4>Example</h4>

     var point = new createjs.Point(0, 100);

Rectangle.description:
Represents a rectangle as defined by the points (x, y) and (x+width, y+height).

<h4>Example</h4>

     var rect = new createjs.Rectangle(0, 0, 100, 100);

ButtonHelper.description:
The ButtonHelper is a helper class to create interactive buttons from {{#crossLink "MovieClip"}}{{/crossLink}} or
{{#crossLink "Sprite"}}{{/crossLink}} instances. This class will intercept mouse events from an object, and
automatically call {{#crossLink "Sprite/gotoAndStop"}}{{/crossLink}} or {{#crossLink "Sprite/gotoAndPlay"}}{{/crossLink}},
to the respective animation labels, add a pointer cursor, and allows the user to define a hit state frame.

The ButtonHelper instance does not need to be added to the stage, but a reference should be maintained to prevent
garbage collection.

Note that over states will not work unless you call {{#crossLink "Stage/enableMouseOver"}}{{/crossLink}}.

<h4>Example</h4>

     var helper = new createjs.ButtonHelper(myInstance, "out", "over", "down", false, myInstance, "hit");
     myInstance.addEventListener("click", handleClick);
     function handleClick(event) {
         // Click Happened.
     }

Shadow.description:
This class encapsulates the properties required to define a shadow to apply to a {{#crossLink "DisplayObject"}}{{/crossLink}}
via its <code>shadow</code> property.

<h4>Example</h4>

     myImage.shadow = new createjs.Shadow("#000000", 5, 5, 10);

Graphics.description:
The Graphics class exposes an easy to use API for generating vector drawing instructions and drawing them to a
specified context. Note that you can use Graphics without any dependency on the EaselJS framework by calling {{#crossLink "Graphics/draw"}}{{/crossLink}}
directly, or it can be used with the {{#crossLink "Shape"}}{{/crossLink}} object to draw vector graphics within the
context of an EaselJS display list.

There are two approaches to working with Graphics object: calling methods on a Graphics instance (the "Graphics API"), or
instantiating Graphics command objects and adding them to the graphics queue via {{#crossLink "Graphics/append"}}{{/crossLink}}.
The former abstracts the latter, simplifying beginning and ending paths, fills, and strokes.

     var g = new createjs.Graphics();
     g.setStrokeStyle(1);
     g.beginStroke("#000000");
     g.beginFill("red");
     g.drawCircle(0,0,30);

All drawing methods in Graphics return the Graphics instance, so they can be chained together. For example,
the following line of code would generate the instructions to draw a rectangle with a red stroke and blue fill:

     myGraphics.beginStroke("red").beginFill("blue").drawRect(20, 20, 100, 50);

Each graphics API call generates a command object (see below). The last command to be created can be accessed via
{{#crossLink "Graphics/command:property"}}{{/crossLink}}:

     var fillCommand = myGraphics.beginFill("red").command;
     // ... later, update the fill style/color:
     fillCommand.style = "blue";
     // or change it to a bitmap fill:
     fillCommand.bitmap(myImage);

For more direct control of rendering, you can instantiate and append command objects to the graphics queue directly. In this case, you
need to manage path creation manually, and ensure that fill/stroke is applied to a defined path:

     // start a new path. Graphics.beginCmd is a reusable BeginPath instance:
     myGraphics.append(createjs.Graphics.beginCmd);
     // we need to define the path before applying the fill:
     var circle = new createjs.Graphics.Circle(0,0,30);
     myGraphics.append(circle);
     // fill the path we just defined:
     var fill = new createjs.Graphics.Fill("red");
     myGraphics.append(fill);

These approaches can be used together, for example to insert a custom command:

     myGraphics.beginFill("red");
     var customCommand = new CustomSpiralCommand(etc);
     myGraphics.append(customCommand);
     myGraphics.beginFill("blue");
     myGraphics.drawCircle(0, 0, 30);

See {{#crossLink "Graphics/append"}}{{/crossLink}} for more info on creating custom commands.

<h4>Tiny API</h4>
The Graphics class also includes a "tiny API", which is one or two-letter methods that are shortcuts for all of the
Graphics methods. These methods are great for creating compact instructions, and is used by the Toolkit for CreateJS
to generate readable code. All tiny methods are marked as protected, so you can view them by enabling protected
descriptions in the docs.

<table>
    <tr><td><b>Tiny</b></td><td><b>Method</b></td><td><b>Tiny</b></td><td><b>Method</b></td></tr>
    <tr><td>mt</td><td>{{#crossLink "Graphics/moveTo"}}{{/crossLink}} </td>
    <td>lt</td> <td>{{#crossLink "Graphics/lineTo"}}{{/crossLink}}</td></tr>
    <tr><td>a/at</td><td>{{#crossLink "Graphics/arc"}}{{/crossLink}} / {{#crossLink "Graphics/arcTo"}}{{/crossLink}} </td>
    <td>bt</td><td>{{#crossLink "Graphics/bezierCurveTo"}}{{/crossLink}} </td></tr>
    <tr><td>qt</td><td>{{#crossLink "Graphics/quadraticCurveTo"}}{{/crossLink}} (also curveTo)</td>
    <td>r</td><td>{{#crossLink "Graphics/rect"}}{{/crossLink}} </td></tr>
    <tr><td>cp</td><td>{{#crossLink "Graphics/closePath"}}{{/crossLink}} </td>
    <td>c</td><td>{{#crossLink "Graphics/clear"}}{{/crossLink}} </td></tr>
    <tr><td>f</td><td>{{#crossLink "Graphics/beginFill"}}{{/crossLink}} </td>
    <td>lf</td><td>{{#crossLink "Graphics/beginLinearGradientFill"}}{{/crossLink}} </td></tr>
    <tr><td>rf</td><td>{{#crossLink "Graphics/beginRadialGradientFill"}}{{/crossLink}} </td>
    <td>bf</td><td>{{#crossLink "Graphics/beginBitmapFill"}}{{/crossLink}} </td></tr>
    <tr><td>ef</td><td>{{#crossLink "Graphics/endFill"}}{{/crossLink}} </td>
    <td>ss / sd</td><td>{{#crossLink "Graphics/setStrokeStyle"}}{{/crossLink}} / {{#crossLink "Graphics/setStrokeDash"}}{{/crossLink}} </td></tr>
    <tr><td>s</td><td>{{#crossLink "Graphics/beginStroke"}}{{/crossLink}} </td>
    <td>ls</td><td>{{#crossLink "Graphics/beginLinearGradientStroke"}}{{/crossLink}} </td></tr>
    <tr><td>rs</td><td>{{#crossLink "Graphics/beginRadialGradientStroke"}}{{/crossLink}} </td>
    <td>bs</td><td>{{#crossLink "Graphics/beginBitmapStroke"}}{{/crossLink}} </td></tr>
    <tr><td>es</td><td>{{#crossLink "Graphics/endStroke"}}{{/crossLink}} </td>
    <td>dr</td><td>{{#crossLink "Graphics/drawRect"}}{{/crossLink}} </td></tr>
    <tr><td>rr</td><td>{{#crossLink "Graphics/drawRoundRect"}}{{/crossLink}} </td>
    <td>rc</td><td>{{#crossLink "Graphics/drawRoundRectComplex"}}{{/crossLink}} </td></tr>
    <tr><td>dc</td><td>{{#crossLink "Graphics/drawCircle"}}{{/crossLink}} </td>
    <td>de</td><td>{{#crossLink "Graphics/drawEllipse"}}{{/crossLink}} </td></tr>
    <tr><td>dp</td><td>{{#crossLink "Graphics/drawPolyStar"}}{{/crossLink}} </td>
    <td>p</td><td>{{#crossLink "Graphics/decodePath"}}{{/crossLink}} </td></tr>
</table>

Here is the above example, using the tiny API instead.

     myGraphics.s("red").f("blue").r(20, 20, 100, 50);

Graphics.Stage.description:
A stage is the root level {{#crossLink "Container"}}{{/crossLink}} for a display list. Each time its {{#crossLink "Stage/tick"}}{{/crossLink}}
method is called, it will render its display list to its target canvas.

<h4>Example</h4>
This example creates a stage, adds a child to it, then uses {{#crossLink "Ticker"}}{{/crossLink}} to update the child
and redraw the stage using {{#crossLink "Stage/update"}}{{/crossLink}}.

     var stage = new createjs.Stage("canvasElementId");
     var image = new createjs.Bitmap("imagePath.png");
     stage.addChild(image);
     createjs.Ticker.addEventListener("tick", handleTick);
     function handleTick(event) {
         image.x += 10;
         stage.update();
     }

Graphics.Shape.description:
A Shape allows you to display vector art in the display list. It composites a {{#crossLink "Graphics"}}{{/crossLink}}
instance which exposes all of the vector drawing methods. The Graphics instance can be shared between multiple Shape
instances to display the same vector graphics with different positions or transforms.

If the vector art will not
change between draws, you may want to use the {{#crossLink "DisplayObject/cache"}}{{/crossLink}} method to reduce the
rendering cost.

<h4>Example</h4>

     var graphics = new createjs.Graphics().beginFill("#ff0000").drawRect(0, 0, 100, 100);
     var shape = new createjs.Shape(graphics);

     //Alternatively use can also use the graphics property of the Shape class to renderer the same as above.
     var shape = new createjs.Shape();
     shape.graphics.beginFill("#ff0000").drawRect(0, 0, 100, 100);

Graphics.MovieClip.description:
The MovieClip class associates a TweenJS Timeline with an EaselJS {{#crossLink "Container"}}{{/crossLink}}. It allows
you to create objects which encapsulate timeline animations, state changes, and synched actions. Due to the
complexities inherent in correctly setting up a MovieClip, it is largely intended for tool output and is not included
in the main EaselJS library.

Currently MovieClip only works properly if it is tick based (as opposed to time based) though some concessions have
been made to support time-based timelines in the future.

<h4>Example</h4>
This example animates two shapes back and forth. The grey shape starts on the left, but we jump to a mid-point in
the animation using {{#crossLink "MovieClip/gotoAndPlay"}}{{/crossLink}}.

     var stage = new createjs.Stage("canvas");
     createjs.Ticker.addEventListener("tick", stage);

     var mc = new createjs.MovieClip(null, 0, true, {start:20});
     stage.addChild(mc);

     var child1 = new createjs.Shape(
         new createjs.Graphics().beginFill("#999999")
             .drawCircle(30,30,30));
     var child2 = new createjs.Shape(
         new createjs.Graphics().beginFill("#5a9cfb")
             .drawCircle(30,30,30));

     mc.timeline.addTween(
         createjs.Tween.get(child1)
             .to({x:0}).to({x:60}, 50).to({x:0}, 50));
     mc.timeline.addTween(
         createjs.Tween.get(child2)
             .to({x:60}).to({x:0}, 50).to({x:60}, 50));

     mc.gotoAndPlay("start");

It is recommended to use <code>tween.to()</code> to animate and set properties (use no duration to have it set
immediately), and the <code>tween.wait()</code> method to create delays between animations. Note that using the
<code>tween.set()</code> method to affect properties will likely not provide the desired result.

Graphics.BlurFilter.description:
Applies a box blur to DisplayObjects. Note that this filter is fairly CPU intensive, particularly if the quality is
set higher than 1.

<h4>Example</h4>
This example creates a red circle, and then applies a 5 pixel blur to it. It uses the {{#crossLink "Filter/getBounds"}}{{/crossLink}}
method to account for the spread that the blur causes.

     var shape = new createjs.Shape().set({x:100,y:100});
     shape.graphics.beginFill("#ff0000").drawCircle(0,0,50);

     var blurFilter = new createjs.BlurFilter(5, 5, 1);
     shape.filters = [blurFilter];
     var bounds = blurFilter.getBounds();

     shape.cache(-50+bounds.x, -50+bounds.y, 100+bounds.width, 100+bounds.height);

See {{#crossLink "Filter"}}{{/crossLink}} for an more information on applying filters.

Graphics.AlphaMapFilter.description:
Applies a greyscale alpha map image (or canvas) to the target, such that the alpha channel of the result will
be copied from the red channel of the map, and the RGB channels will be copied from the target.

Generally, it is recommended that you use {{#crossLink "AlphaMaskFilter"}}{{/crossLink}}, because it has much
better performance.

<h4>Example</h4>
This example draws a red->blue box, caches it, and then uses the cache canvas as an alpha map on a 100x100 image.

      var box = new createjs.Shape();
      box.graphics.beginLinearGradientFill(["#ff0000", "#0000ff"], [0, 1], 0, 0, 0, 100)
      box.graphics.drawRect(0, 0, 100, 100);
      box.cache(0, 0, 100, 100);

      var bmp = new createjs.Bitmap("path/to/image.jpg");
      bmp.filters = [
          new createjs.AlphaMapFilter(box.cacheCanvas)
      ];
      bmp.cache(0, 0, 100, 100);
      stage.addChild(bmp);

See {{#crossLink "Filter"}}{{/crossLink}} for more information on applying filters.

Graphics.AlphaMaskFilter.description:
Applies the alpha from the mask image (or canvas) to the target, such that the alpha channel of the result will
be derived from the mask, and the RGB channels will be copied from the target. This can be used, for example, to
apply an alpha mask to a display object. This can also be used to combine a JPG compressed RGB image with a PNG32
alpha mask, which can result in a much smaller file size than a single PNG32 containing ARGB.

<b>IMPORTANT NOTE: This filter currently does not support the targetCtx, or targetX/Y parameters correctly.</b>

<h4>Example</h4>
This example draws a gradient box, then caches it and uses the "cacheCanvas" as the alpha mask on a 100x100 image.

     var box = new createjs.Shape();
     box.graphics.beginLinearGradientFill(["#000000", "rgba(0, 0, 0, 0)"], [0, 1], 0, 0, 100, 100)
     box.graphics.drawRect(0, 0, 100, 100);
     box.cache(0, 0, 100, 100);

     var bmp = new createjs.Bitmap("path/to/image.jpg");
     bmp.filters = [
         new createjs.AlphaMaskFilter(box.cacheCanvas)
     ];
     bmp.cache(0, 0, 100, 100);

See {{#crossLink "Filter"}}{{/crossLink}} for more information on applying filters.

Graphics.ColorFilter.description:
Applies a color transform to DisplayObjects.

<h4>Example</h4>
This example draws a red circle, and then transforms it to Blue. This is accomplished by multiplying all the channels
to 0 (except alpha, which is set to 1), and then adding 255 to the blue channel.

     var shape = new createjs.Shape().set({x:100,y:100});
     shape.graphics.beginFill("#ff0000").drawCircle(0,0,50);

     shape.filters = [
         new createjs.ColorFilter(0,0,0,1, 0,0,255,0)
     ];
     shape.cache(-50, -50, 100, 100);

See {{#crossLink "Filter"}}{{/crossLink}} for an more information on applying filters.

Graphics.ColorMatrix.description:
Provides helper functions for assembling a matrix for use with the {{#crossLink "ColorMatrixFilter"}}{{/crossLink}}.
Most methods return the instance to facilitate chained calls.

<h4>Example</h4>

     myColorMatrix.adjustHue(20).adjustBrightness(50);

See {{#crossLink "Filter"}}{{/crossLink}} for an example of how to apply filters, or {{#crossLink "ColorMatrixFilter"}}{{/crossLink}}
for an example of how to use ColorMatrix to change a DisplayObject's color.

Graphics.ColorMatrixFilter.description:
Allows you to carry out complex color operations such as modifying saturation, brightness, or inverting. See the
{{#crossLink "ColorMatrix"}}{{/crossLink}} for more information on changing colors. For an easier color transform,
consider the {{#crossLink "ColorFilter"}}{{/crossLink}}.

<h4>Example</h4>
This example creates a red circle, inverts its hue, and then saturates it to brighten it up.

     var shape = new createjs.Shape().set({x:100,y:100});
     shape.graphics.beginFill("#ff0000").drawCircle(0,0,50);

     var matrix = new createjs.ColorMatrix().adjustHue(180).adjustSaturation(100);
     shape.filters = [
         new createjs.ColorMatrixFilter(matrix)
     ];

     shape.cache(-50, -50, 100, 100);

See {{#crossLink "Filter"}}{{/crossLink}} for an more information on applying filters.

Graphics.Touch.description:
Global utility for working with multi-touch enabled devices in EaselJS. Currently supports W3C Touch API (iOS and
modern Android browser) and the Pointer API (IE), including ms-prefixed events in IE10, and unprefixed in IE11.

Ensure that you {{#crossLink "Touch/disable"}}{{/crossLink}} touch when cleaning up your application. You do not have
to check if touch is supported to enable it, as it will fail gracefully if it is not supported.

<h4>Example</h4>

     var stage = new createjs.Stage("canvasId");
     createjs.Touch.enable(stage);

<strong>Note:</strong> It is important to disable Touch on a stage that you are no longer using:

     createjs.Touch.disable(stage);

Graphics.SpriteContainer.description:
A SpriteContainer is a nestable display list that enables aggressively optimized rendering of bitmap content.
In order to accomplish these optimizations, SpriteContainer enforces a few restrictions on its content.

Restrictions:
    - only Sprite, SpriteContainer, BitmapText and DOMElement are allowed to be added as children.
    - a spriteSheet MUST be either be passed into the constructor or defined on the first child added.
    - all children (with the exception of DOMElement) MUST use the same spriteSheet.

<h4>Example</h4>

     var data = {
         images: ["sprites.jpg"],
         frames: {width:50, height:50},
         animations: {run:[0,4], jump:[5,8,"run"]}
     };
     var spriteSheet = new createjs.SpriteSheet(data);
     var container = new createjs.SpriteContainer(spriteSheet);
     container.addChild(spriteInstance, spriteInstance2);
     container.x = 100;

<strong>Note:</strong> SpriteContainer is not included in the minified version of EaselJS.

Graphics.SpriteStage.description:
A sprite stage is the root level {{#crossLink "Container"}}{{/crossLink}} for an aggressively optimized display list. Each time its {{#crossLink "Stage/tick"}}{{/crossLink}}
method is called, it will render its display list to its target canvas. WebGL content is fully compatible with the existing Context2D renderer.
On devices or browsers that don't support WebGL, content will automatically be rendered via canvas 2D.

Restrictions:
    - only Sprite, SpriteContainer, BitmapText, Bitmap and DOMElement are allowed to be added to the display list.
    - a child being added (with the exception of DOMElement) MUST have an image or spriteSheet defined on it.
    - a child's image/spriteSheet MUST never change while being on the display list.

<h4>Example</h4>
This example creates a sprite stage, adds a child to it, then uses {{#crossLink "Ticker"}}{{/crossLink}} to update the child
and redraw the stage using {{#crossLink "SpriteStage/update"}}{{/crossLink}}.

     var stage = new createjs.SpriteStage("canvasElementId", false, false);
     stage.updateViewport(800, 600);
     var image = new createjs.Bitmap("imagePath.png");
     stage.addChild(image);
     createjs.Ticker.addEventListener("tick", handleTick);
     function handleTick(event) {
         image.x += 10;
         stage.update();
     }

<strong>Note:</strong> SpriteStage is not included in the minified version of EaselJS.

Graphics.JSONLoader.description:
A loader for JSON files. To load JSON cross-domain, use JSONP and the {{#crossLink "JSONPLoader"}}{{/crossLink}}
instead. To load JSON-formatted manifests, use {{#crossLink "ManifestLoader"}}{{/crossLink}}, and to
load EaselJS SpriteSheets, use {{#crossLink "SpriteSheetLoader"}}{{/crossLink}}.

Graphics.JSONPLoader.description:
A loader for JSONP files, which are JSON-formatted text files, wrapped in a callback. To load regular JSON
without a callback use the {{#crossLink "JSONLoader"}}{{/crossLink}} instead. To load JSON-formatted manifests,
use {{#crossLink "ManifestLoader"}}{{/crossLink}}, and to load EaselJS SpriteSheets, use
{{#crossLink "SpriteSheetLoader"}}{{/crossLink}}.

JSONP is a format that provides a solution for loading JSON files cross-domain <em>without</em> requiring CORS.
JSONP files are loaded as JavaScript, and the "callback" is executed once they are loaded. The callback in the
JSONP must match the callback passed to the loadItem.

<h4>Example JSONP</h4>

		callbackName({
			"name": "value",
	 		"num": 3,
			"obj": { "bool":true }
		});

<h4>Example</h4>

		var loadItem = {id:"json", type:"jsonp", src:"http://server.com/text.json", callback:"callbackName"}
		var queue = new createjs.LoadQueue();
		queue.on("complete", handleComplete);
		queue.loadItem(loadItem);

		function handleComplete(event) }
			var json = queue.getResult("json");
			console.log(json.obj.bool); // true
		}

Note that JSONP files loaded concurrently require a <em>unique</em> callback. To ensure JSONP files are loaded
in order, either use the {{#crossLink "LoadQueue/setMaxConnections"}}{{/crossLink}} method (set to 1),
or set {{#crossLink "LoadItem/maintainOrder:property"}}{{/crossLink}} on items with the same callback.

Graphics.SpriteSheetLoader.description:
A loader for EaselJS SpriteSheets. Images inside the spritesheet definition are loaded before the loader
completes. To load SpriteSheets using JSONP, specify a {{#crossLink "LoadItem/callback:property"}}{{/crossLink}}
as part of the {{#crossLink "LoadItem"}}{{/crossLink}}. Note that the {{#crossLink "JSONLoader"}}{{/crossLink}}
and {{#crossLink "JSONPLoader"}}{{/crossLink}} are higher priority loaders, so SpriteSheets <strong>must</strong>
set the {{#crossLink "LoadItem"}}{{/crossLink}} {{#crossLink "LoadItem/type:property"}}{{/crossLink}} property
to {{#crossLink "AbstractLoader/SPRITESHEET:property"}}{{/crossLink}}.

The {{#crossLink "LoadItem"}}{{/crossLink}} {{#crossLink "LoadItem/crossOrigin:property"}}{{/crossLink}} as well
as the {{#crossLink "LoadQueue's"}}{{/crossLink}} `basePath` argument and {{#crossLink "LoadQueue/_preferXHR"}}{{/crossLink}}
property supplied to the {{#crossLink "LoadQueue"}}{{/crossLink}} are passed on to the sub-manifest that loads
the SpriteSheet images.

Note that the SpriteSheet JSON does not respect the {{#crossLink "LoadQueue/_preferXHR:property"}}{{/crossLink}}
property, which should instead be determined by the presence of a {{#crossLink "LoadItem/callback:property"}}{{/crossLink}}
property on the SpriteSheet load item. This is because the JSON loaded will have a different format depending on
if it is loaded as JSON, so just changing `preferXHR` is not enough to change how it is loaded.

Graphics.SoundJS.description:
Static class holding library specific information such as the version and buildDate of the library.
The SoundJS class has been renamed {{#crossLink "Sound"}}{{/crossLink}}.  Please see {{#crossLink "Sound"}}{{/crossLink}}
for information on using sound.

Graphics.AbstractSoundInstance.description:
A AbstractSoundInstance is created when any calls to the Sound API method {{#crossLink "Sound/play"}}{{/crossLink}} or
{{#crossLink "Sound/createInstance"}}{{/crossLink}} are made. The AbstractSoundInstance is returned by the active plugin
for control by the user.

<h4>Example</h4>

     var myInstance = createjs.Sound.play("myAssetPath/mySrcFile.mp3");

A number of additional parameters provide a quick way to determine how a sound is played. Please see the Sound
API method {{#crossLink "Sound/play"}}{{/crossLink}} for a list of arguments.

Once a AbstractSoundInstance is created, a reference can be stored that can be used to control the audio directly through
the AbstractSoundInstance. If the reference is not stored, the AbstractSoundInstance will play out its audio (and any loops), and
is then de-referenced from the {{#crossLink "Sound"}}{{/crossLink}} class so that it can be cleaned up. If audio
playback has completed, a simple call to the {{#crossLink "AbstractSoundInstance/play"}}{{/crossLink}} instance method
will rebuild the references the Sound class need to control it.

     var myInstance = createjs.Sound.play("myAssetPath/mySrcFile.mp3", {loop:2});
     myInstance.on("loop", handleLoop);
     function handleLoop(event) {
         myInstance.volume = myInstance.volume * 0.5;
     }

Events are dispatched from the instance to notify when the sound has completed, looped, or when playback fails

     var myInstance = createjs.Sound.play("myAssetPath/mySrcFile.mp3");
     myInstance.on("complete", handleComplete);
     myInstance.on("loop", handleLoop);
     myInstance.on("failed", handleFailed);

Graphics.Tween.description:
A Tween instance tweens properties for a single target. Instance methods can be chained for easy construction and sequencing:

<h4>Example</h4>

     target.alpha = 1;
	    createjs.Tween.get(target)
	         .wait(500)
	         .to({alpha:0, visible:false}, 1000)
	         .call(handleComplete);
	    function handleComplete() {
	    	//Tween complete
	    }

Multiple tweens can point to the same instance, however if they affect the same properties there could be unexpected
behaviour. To stop all tweens on an object, use {{#crossLink "Tween/removeTweens"}}{{/crossLink}} or pass `override:true`
in the props argument.

     createjs.Tween.get(target, {override:true}).to({x:100});

Subscribe to the {{#crossLink "Tween/change:event"}}{{/crossLink}} event to get notified when a property of the
target is changed.

     createjs.Tween.get(target, {override:true}).to({x:100}).addEventListener("change", handleChange);
     function handleChange(event) {
         // The tween changed.
     }

See the Tween {{#crossLink "Tween/get"}}{{/crossLink}} method for additional param documentation.

params.description:
An object defining labels for using {{#crossLink "Timeline/gotoAndPlay"}}{{/crossLink}}/{{#crossLink "Timeline/gotoAndStop"}}{{/crossLink}}.
See {{#crossLink "Timeline/setLabels"}}{{/crossLink}}
for details.

classitems.description:
Sets up the prototype chain and constructor property for a new class.

This should be called right after creating the class constructor.

	function MySubClass() {}
	createjs.extend(MySubClass, MySuperClass);
	MySubClass.prototype.doSomething = function() { }

	var foo = new MySubClass();
	console.log(foo instanceof MySuperClass); // true
	console.log(foo.prototype.constructor === MySubClass); // true

Promotes any methods on the super class that were overridden, by creating an alias in the format `prefix_methodName`.
It is recommended to use the super class's name as the prefix.
An alias to the super class's constructor is always added in the format `prefix_constructor`.
This allows the subclass to call super class methods without using `function.call`, providing better performance.

For example, if `MySubClass` extends `MySuperClass`, and both define a `draw` method, then calling `promote(MySubClass, "MySuperClass")`
would add a `MySuperClass_constructor` method to MySubClass and promote the `draw` method on `MySuperClass` to the
prototype of `MySubClass` as `MySuperClass_draw`.

This should be called after the class's prototype is fully defined.

	function ClassA(name) {
		this.name = name;
	}
	ClassA.prototype.greet = function() {
		return "Hello "+this.name;
	}

	function ClassB(name, punctuation) {
		this.ClassA_constructor(name);
		this.punctuation = punctuation;
	}
	createjs.extend(ClassB, ClassA);
	ClassB.prototype.greet = function() {
		return this.ClassA_greet()+this.punctuation;
	}
	createjs.promote(ClassB, "ClassA");

	var foo = new ClassB("World", "!?!");
	console.log(foo.greet()); // Hello World!?!

Finds the first occurrence of a specified value searchElement in the passed in array, and returns the index of
that value.  Returns -1 if value is not found.

     var i = createjs.indexOf(myArray, myElementToFind);

Causes the active listener to be removed via removeEventListener();

		myBtn.addEventListener("click", function(evt) {
			// do stuff...
			evt.remove(); // removes this listener.
		});

Adds the specified event listener. Note that adding multiple listeners to the same function will result in
multiple callbacks getting fired.

<h4>Example</h4>

     displayObject.addEventListener("click", handleClick);
     function handleClick(event) {
        // Click happened.
     }

A shortcut method for using addEventListener that makes it easier to specify an execution scope, have a listener
only run once, associate arbitrary data with the listener, and remove the listener.

This method works by creating an anonymous wrapper function and subscribing it with addEventListener.
The wrapper function is returned for use with `removeEventListener` (or `off`).

<b>IMPORTANT:</b> To remove a listener added with `on`, you must pass in the returned wrapper function as the listener, or use
{{#crossLink "Event/remove"}}{{/crossLink}}. Likewise, each time you call `on` a NEW wrapper function is subscribed, so multiple calls
to `on` with the same params will create multiple listeners.

<h4>Example</h4>

		var listener = myBtn.on("click", handleClick, null, false, {count:3});
		function handleClick(evt, data) {
			data.count -= 1;
			console.log(this == myBtn); // true - scope defaults to the dispatcher
			if (data.count == 0) {
				alert("clicked 3 times!");
				myBtn.off("click", listener);
				// alternately: evt.remove();
			}
		}

Removes all listeners for the specified type, or all listeners of all types.

<h4>Example</h4>

     // Remove all listeners
     displayObject.removeAllEventListeners();

     // Remove all click listeners
     displayObject.removeAllEventListeners("click");

Dispatches the specified event to all listeners.

<h4>Example</h4>

     // Use a string event
     this.dispatchEvent("complete");

     // Use an Event instance
     var event = new createjs.Event("progress");
     this.dispatchEvent(event);

Dispatched each tick. The event will be dispatched to each listener even when the Ticker has been paused using
{{#crossLink "Ticker/setPaused"}}{{/crossLink}}.

<h4>Example</h4>

     createjs.Ticker.addEventListener("tick", handleTick);
     function handleTick(event) {
         console.log("Paused:", event.paused, event.delta);
     }

When the ticker is paused, all listeners will still receive a tick event, but the <code>paused</code> property
of the event will be `true`. Also, while paused the `runTime` will not increase. See {{#crossLink "Ticker/tick:event"}}{{/crossLink}},
{{#crossLink "Ticker/getTime"}}{{/crossLink}}, and {{#crossLink "Ticker/getEventTime"}}{{/crossLink}} for more
info.

<h4>Example</h4>

     createjs.Ticker.addEventListener("tick", handleTick);
     createjs.Ticker.paused = true;
     function handleTick(event) {
         console.log(event.paused,
         	createjs.Ticker.getTime(false),
         	createjs.Ticker.getTime(true));
     }

Prepends the specified matrix to this matrix.
This is the equivalent of multiplying `(specified matrix) * (this matrix)`.
For example, you could calculate the combined transformation for a child object using:

	var o = myDisplayObject;
	var mtx = o.getMatrix();
	while (o = o.parent) {
		// prepend each parent's transformation in turn:
		o.prependMatrix(o.getMatrix());
	}

Generates matrix properties from the specified display object transform properties, and appends them to this matrix.
For example, you can use this to generate a matrix representing the transformations of a display object:

	var mtx = new createjs.Matrix2D();
	mtx.appendTransform(o.x, o.y, o.scaleX, o.scaleY, o.rotation);

Generates matrix properties from the specified display object transform properties, and prepends them to this matrix.
For example, you could calculate the combined transformation for a child object using:

	var o = myDisplayObject;
	var mtx = new createjs.Matrix2D();
	do  {
		// prepend each parent's transformation in turn:
		mtx.prependTransform(o.x, o.y, o.scaleX, o.scaleY, o.rotation, o.skewX, o.skewY, o.regX, o.regY);
	} while (o = o.parent);

	Note that the above example would not account for {{#crossLink "DisplayObject/transformMatrix:property"}}{{/crossLink}}
	values. See {{#crossLink "Matrix2D/prependMatrix"}}{{/crossLink}} for an example that does.

Prepends the specified display properties. This is generally used to apply a parent's properties to a child's.
For example, to get the combined display properties that would be applied to a child, you could use:

	var o = myDisplayObject;
	var props = new createjs.DisplayProps();
	do {
		// prepend each parent's props in turn:
		props.prepend(o.visible, o.alpha, o.shadow, o.compositeOperation, o.getMatrix());
	} while (o = o.parent);

Dispatched when all images are loaded.  Note that this only fires if the images
were not fully loaded when the sprite sheet was initialized. You should check the complete property
to prior to adding a listener. Ex.

	var sheet = new createjs.SpriteSheet(data);
	if (!sheet.complete) {
		// not preloaded, listen for the complete event:
		sheet.addEventListener("complete", handler);
	}

Dispatched when an image encounters an error. A SpriteSheet will dispatch an error event for each image that
encounters an error, and will still dispatch a {{#crossLink "SpriteSheet/complete:event"}}{{/crossLink}}
event once all images are finished processing, even if an error is encountered.

Holds a reference to the last command that was created or appended. For example, you could retain a reference
to a Fill command in order to dynamically update the color later by using:

		var myFill = myGraphics.beginFill("red").command;
		// update color later:
		myFill.style = "yellow";

Returns a CSS compatible color string based on the specified RGB numeric color values in the format
"rgba(255,255,255,1.0)", or if alpha is null then in the format "rgb(255,255,255)". For example,

     createjs.Graphics.getRGB(50, 100, 150, 0.5);
     // Returns "rgba(50,100,150,0.5)"

It also supports passing a single hex color value as the first param, and an optional alpha value as the second
param. For example,

     createjs.Graphics.getRGB(0xFF00FF, 0.2);
     // Returns "rgba(255,0,255,0.2)"

Returns a CSS compatible color string based on the specified HSL numeric color values in the format "hsla(360,100,100,1.0)",
or if alpha is null then in the format "hsl(360,100,100)".

     createjs.Graphics.getHSL(150, 100, 70);
     // Returns "hsl(150,100,70)"

Sets or clears the stroke dash pattern.

	myGraphics.setStrokeDash([20, 10], 0);

A tiny API method `sd` also exists.

Draws a circle with the specified radius at (x, y).

     var g = new createjs.Graphics();
	    g.setStrokeStyle(1);
	    g.beginStroke(createjs.Graphics.getRGB(0,0,0));
	    g.beginFill(createjs.Graphics.getRGB(255,0,0));
	    g.drawCircle(0,0,3);

	    var s = new createjs.Shape(g);
		s.x = 100;
		s.y = 100;

	    stage.addChild(s);
	    stage.update();

A tiny API method "dc" also exists.

Draws a star if pointSize is greater than 0, or a regular polygon if pointSize is 0 with the specified number of
points. For example, the following code will draw a familiar 5 pointed star shape centered at 100, 100 and with a
radius of 50:

     myGraphics.beginFill("#FF0").drawPolyStar(100, 100, 50, 5, 0.6, -90);
     // Note: -90 makes the first point vertical

A tiny API method "dp" also exists.

Appends a graphics command object to the graphics queue. Command objects expose an "exec" method
that accepts two parameters: the Context2D to operate on, and an arbitrary data object passed into
{{#crossLink "Graphics/draw"}}{{/crossLink}}. The latter will usually be the Shape instance that called draw.

This method is used internally by Graphics methods, such as drawCircle, but can also be used directly to insert
built-in or custom graphics commands. For example:

		// attach data to our shape, so we can access it during the draw:
		myShape.color = "red";

		// append a Circle command object:
		myShape.graphics.append(new createjs.Graphics.Circle(50, 50, 30));

		// append a custom command object with an exec method that sets the fill style
		// based on the shape's data, and then fills the circle.
		myShape.graphics.append({exec:function(ctx, shape) {
			ctx.fillStyle = shape.color;
			ctx.fill();
		}});

Stores all graphics commands so they won't be executed in future draws. Calling store() a second time adds to
the existing store. This also affects `drawAsPath()`.

This is useful in cases where you are creating vector graphics in an iterative manner (ex. generative art), so
that only new graphics need to be drawn (which can provide huge performance benefits), but you wish to retain all
of the vector instructions for later use (ex. scaling, modifying, or exporting).

Note that calling store() will force the active path (if any) to be ended in a manner similar to changing
the fill or stroke.

For example, consider a application where the user draws lines with the mouse. As each line segment (or collection of
segments) are added to a Shape, it can be rasterized using {{#crossLink "DisplayObject/updateCache"}}{{/crossLink}},
and then stored, so that it can be redrawn at a different scale when the application is resized, or exported to SVG.

	// set up cache:
	myShape.cache(0,0,500,500,scale);

	// when the user drags, draw a new line:
	myShape.graphics.moveTo(oldX,oldY).lineTo(newX,newY);
	// then draw it into the existing cache:
	myShape.updateCache("source-over");
	// store the new line, so it isn't redrawn next time:
	myShape.store();

	// then, when the window resizes, we can re-render at a different scale:
	// first, unstore all our lines:
	myShape.unstore();
	// then cache using the new scale:
	myShape.cache(0,0,500,500,newScale);
	// finally, store the existing commands again:
	myShape.store();

An array of Filter objects to apply to this display object. Filters are only applied / updated when {{#crossLink "cache"}}{{/crossLink}}
or {{#crossLink "updateCache"}}{{/crossLink}} is called on the display object, and only apply to the area that is
cached.

Redraws the display object to its cache. Calling updateCache without an active cache will throw an error.
If compositeOperation is null the current cache will be cleared prior to drawing. Otherwise the display object
will be drawn over the existing cache using the specified compositeOperation.

<h4>Example</h4>
Clear the current graphics of a cached shape, draw some new instructions, and then update the cache. The new line
will be drawn on top of the old one.

     // Not shown: Creating the shape, and caching it.
     shapeInstance.clear();
     shapeInstance.setStrokeStyle(3).beginStroke("#ff0000").moveTo(100, 100).lineTo(200,200);
     shapeInstance.updateCache();

Transforms the specified x and y position from the coordinate space of the display object
to the global (stage) coordinate space. For example, this could be used to position an HTML label
over a specific point on a nested display object. Returns a Point instance with x and y properties
correlating to the transformed coordinates on the stage.

<h4>Example</h4>

     displayObject.x = 300;
     displayObject.y = 200;
     stage.addChild(displayObject);
     var point = displayObject.localToGlobal(100, 100);
     // Results in x=400, y=300

Transforms the specified x and y position from the global (stage) coordinate space to the
coordinate space of the display object. For example, this could be used to determine
the current mouse position within the display object. Returns a Point instance with x and y properties
correlating to the transformed position in the display object's coordinate space.

<h4>Example</h4>

     displayObject.x = 300;
     displayObject.y = 200;
     stage.addChild(displayObject);
     var point = displayObject.globalToLocal(100, 100);
     // Results in x=-200, y=-100

Transforms the specified x and y position from the coordinate space of this display object to the coordinate
space of the target display object. Returns a Point instance with x and y properties correlating to the
transformed position in the target's coordinate space. Effectively the same as using the following code with
{{#crossLink "DisplayObject/localToGlobal"}}{{/crossLink}} and {{#crossLink "DisplayObject/globalToLocal"}}{{/crossLink}}.

     var pt = this.localToGlobal(x, y);
     pt = target.globalToLocal(pt.x, pt.y);

Tests whether the display object intersects the specified point in <em>local</em> coordinates (ie. draws a pixel
with alpha > 0 at the specified position). This ignores the alpha, shadow, hitArea, mask, and compositeOperation
of the display object.

<h4>Example</h4>

		var myShape = new createjs.Shape();
		myShape.graphics.beginFill("red").drawRect(100, 100, 20, 50);

		console.log(myShape.hitTest(10,10); // false
		console.log(myShape.hitTest(110, 25); // true

Note that to use Stage coordinates (such as {{#crossLink "Stage/mouseX:property"}}{{/crossLink}}), they must
first be converted to local coordinates:

     stage.addEventListener("stagemousedown", handleMouseDown);
     function handleMouseDown(event) {
     	var p = myShape.globalToLocal(stage.mouseX, stage.mouseY);
         var hit = myShape.hitTest(p.x, p.y);
     }

Shape-to-shape collision is not currently supported by EaselJS.

Provides a chainable shortcut method for setting a number of properties on the instance.

<h4>Example</h4>

     var myGraphics = new createjs.Graphics().beginFill("#ff0000").drawCircle(0, 0, 25);
     var shape = stage.addChild(new createjs.Shape()).set({graphics:myGraphics, x:100, y:100, alpha:0.5});

Adds a child to the top of the display list.

<h4>Example</h4>

		container.addChild(bitmapInstance);

You can also add multiple children at once:

		container.addChild(bitmapInstance, shapeInstance, textInstance);

Adds a child to the display list at the specified index, bumping children at equal or greater indexes up one, and
setting its parent to this Container.

<h4>Example</h4>

     addChildAt(child1, index);

You can also add multiple children, such as:

     addChildAt(child1, child2, ..., index);

The index must be between 0 and numChildren. For example, to add myShape under otherShape in the display list,
you could use:

     container.addChildAt(myShape, container.getChildIndex(otherShape));

This would also bump otherShape's index up by one. Fails silently if the index is out of range.

Removes all children from the display list.

<h4>Example</h4>

	container.removeAllChildren();

Returns the child at the specified index.

<h4>Example</h4>

     container.getChildAt(2);

Performs an array sort operation on the child list.

<h4>Example: Display children with a higher y in front.</h4>

     var sortFunction = function(obj1, obj2, options) {
         if (obj1.y > obj2.y) { return 1; }
         if (obj1.y < obj2.y) { return -1; }
         return 0;
     }
     container.sortChildren(sortFunction);

Returns the index of the specified child in the display list, or -1 if it is not in the display list.

<h4>Example</h4>

     var index = container.getChildIndex(child);

Indicates whether the stage should automatically clear the canvas before each render. You can set this to <code>false</code>
to manually control clearing (for generative art, or when pointing multiple stages at the same canvas for
example).

<h4>Example</h4>

     var stage = new createjs.Stage("canvasId");
     stage.autoClear = false;

The canvas the stage will render to. Multiple stages can share a single canvas, but you must disable autoClear for all but the
first stage that will be ticked (or they will clear each other's render).

When changing the canvas property you must disable the events on the old canvas, and enable events on the
new canvas or mouse events will not work as expected. For example:

     myStage.enableDOMEvents(false);
     myStage.canvas = anotherCanvas;
     myStage.enableDOMEvents(true);

If true, mouse move events will continue to be called when the mouse leaves the target canvas. See
{{#crossLink "Stage/mouseInBounds:property"}}{{/crossLink}}, and {{#crossLink "MouseEvent"}}{{/crossLink}}
x/y/rawX/rawY.

Dispatched when the mouse moves from within the canvas area (mouseInBounds == true) to outside it (mouseInBounds == false).
This is currently only dispatched for mouse input (not touch). See the {{#crossLink "MouseEvent"}}{{/crossLink}}
class for a listing of event properties.

Dispatched when the mouse moves into the canvas area (mouseInBounds == false) from outside it (mouseInBounds == true).
This is currently only dispatched for mouse input (not touch). See the {{#crossLink "MouseEvent"}}{{/crossLink}}
class for a listing of event properties.

Each time the update method is called, the stage will call {{#crossLink "Stage/tick"}}{{/crossLink}}
unless {{#crossLink "Stage/tickOnUpdate:property"}}{{/crossLink}} is set to false,
and then render the display list to the canvas.

Propagates a tick event through the display list. This is automatically called by {{#crossLink "Stage/update"}}{{/crossLink}}
unless {{#crossLink "Stage/tickOnUpdate:property"}}{{/crossLink}} is set to false.

If a props object is passed to `tick()`, then all of its properties will be copied to the event object that is
propagated to listeners.

Some time-based features in EaselJS (for example {{#crossLink "Sprite/framerate"}}{{/crossLink}} require that
a {{#crossLink "Ticker/tick:event"}}{{/crossLink}} event object (or equivalent object with a delta property) be
passed as the `props` parameter to `tick()`. For example:

	Ticker.on("tick", handleTick);
	function handleTick(evtObj) {
		// clone the event object from Ticker, and add some custom data to it:
		var evt = evtObj.clone().set({greeting:"hello", name:"world"});

		// pass it to stage.update():
		myStage.update(evt); // subsequently calls tick() with the same param
	}

	// ...
	myDisplayObject.on("tick", handleDisplayObjectTick);
	function handleDisplayObjectTick(evt) {
		console.log(evt.delta); // the delta property from the Ticker tick event object
		console.log(evt.greeting, evt.name); // custom data: "hello world"
	}

Default event handler that calls the Stage {{#crossLink "Stage/update"}}{{/crossLink}} method when a {{#crossLink "DisplayObject/tick:event"}}{{/crossLink}}
event is received. This allows you to register a Stage instance as a event listener on {{#crossLink "Ticker"}}{{/crossLink}}
directly, using:

     Ticker.addEventListener("tick", myStage");

Note that if you subscribe to ticks using this pattern, then the tick event object will be passed through to
display object tick handlers, instead of <code>delta</code> and <code>paused</code> parameters.

Enables or disables (by passing a frequency of 0) mouse over ({{#crossLink "DisplayObject/mouseover:event"}}{{/crossLink}}
and {{#crossLink "DisplayObject/mouseout:event"}}{{/crossLink}}) and roll over events ({{#crossLink "DisplayObject/rollover:event"}}{{/crossLink}}
and {{#crossLink "DisplayObject/rollout:event"}}{{/crossLink}}) for this stage's display list. These events can
be expensive to generate, so they are disabled by default. The frequency of the events can be controlled
independently of mouse move events via the optional `frequency` parameter.

<h4>Example</h4>

     var stage = new createjs.Stage("canvasId");
     stage.enableMouseOver(10); // 10 updates per second

Enables or disables the event listeners that stage adds to DOM elements (window, document and canvas). It is good
practice to disable events when disposing of a Stage instance, otherwise the stage will continue to receive
events from the page.

When changing the canvas property you must disable the events on the old canvas, and enable events on the
new canvas or mouse events will not work as expected. For example:

     myStage.enableDOMEvents(false);
     myStage.canvas = anotherCanvas;
     myStage.enableDOMEvents(true);

Play (unpause) the current animation. The Sprite will be paused if either {{#crossLink "Sprite/stop"}}{{/crossLink}}
or {{#crossLink "Sprite/gotoAndStop"}}{{/crossLink}} is called. Single frame animations will remain
unchanged.

Stop playing a running animation. The Sprite will be playing if {{#crossLink "Sprite/gotoAndPlay"}}{{/crossLink}}
is called. Note that calling {{#crossLink "Sprite/gotoAndPlay"}}{{/crossLink}} or {{#crossLink "Sprite/play"}}{{/crossLink}}
will resume playback.

The TweenJS Timeline that is associated with this MovieClip. This is created automatically when the MovieClip
instance is initialized. Animations are created by adding <a href="http://tweenjs.com">TweenJS</a> Tween
instances to the timeline.

<h4>Example</h4>

     var tween = createjs.Tween.get(target).to({x:0}).to({x:100}, 30);
     var mc = new createjs.MovieClip();
     mc.timeline.addTween(tween);

Elements can be added and removed from the timeline by toggling an "_off" property
using the <code>tweenInstance.to()</code> method. Note that using <code>Tween.set</code> is not recommended to
create MovieClip animations. The following example will toggle the target off on frame 0, and then back on for
frame 1. You can use the "visible" property to achieve the same effect.

     var tween = createjs.Tween.get(target).to({_off:false})
         .wait(1).to({_off:true})
         .wait(1).to({_off:false});

A {{#crossLink "SpriteSheet/framerate:property"}}{{/crossLink}} value that will be passed to new {{#crossLink "SpriteSheet"}}{{/crossLink}} instances that are
created. If no framerate is specified (or it is 0), then SpriteSheets will use the {{#crossLink "Ticker"}}{{/crossLink}}
framerate.

Sets up the prototype chain and constructor property for a new class.

This should be called right after creating the class constructor.

	function MySubClass() {}
	createjs.extend(MySubClass, MySuperClass);
	MySubClass.prototype.doSomething = function() { }

	var foo = new MySubClass();
	console.log(foo instanceof MySuperClass); // true
	console.log(foo.prototype.constructor === MySubClass); // true

Promotes any methods on the super class that were overridden, by creating an alias in the format `prefix_methodName`.
It is recommended to use the super class's name as the prefix.
An alias to the super class's constructor is always added in the format `prefix_constructor`.
This allows the subclass to call super class methods without using `function.call`, providing better performance.

For example, if `MySubClass` extends `MySuperClass`, and both define a `draw` method, then calling `promote(MySubClass, "MySuperClass")`
would add a `MySuperClass_constructor` method to MySubClass and promote the `draw` method on `MySuperClass` to the
prototype of `MySubClass` as `MySuperClass_draw`.

This should be called after the class's prototype is fully defined.

	function ClassA(name) {
		this.name = name;
	}
	ClassA.prototype.greet = function() {
		return "Hello "+this.name;
	}

	function ClassB(name, punctuation) {
		this.ClassA_constructor(name);
		this.punctuation = punctuation;
	}
	createjs.extend(ClassB, ClassA);
	ClassB.prototype.greet = function() {
		return this.ClassA_greet()+this.punctuation;
	}
	createjs.promote(ClassB, "ClassA");

	var foo = new ClassB("World", "!?!");
	console.log(foo.greet()); // Hello World!?!

Finds the first occurrence of a specified value searchElement in the passed in array, and returns the index of
that value.  Returns -1 if value is not found.

     var i = createjs.indexOf(myArray, myElementToFind);

Causes the active listener to be removed via removeEventListener();

		myBtn.addEventListener("click", function(evt) {
			// do stuff...
			evt.remove(); // removes this listener.
		});

Adds the specified event listener. Note that adding multiple listeners to the same function will result in
multiple callbacks getting fired.

<h4>Example</h4>

     displayObject.addEventListener("click", handleClick);
     function handleClick(event) {
        // Click happened.
     }

A shortcut method for using addEventListener that makes it easier to specify an execution scope, have a listener
only run once, associate arbitrary data with the listener, and remove the listener.

This method works by creating an anonymous wrapper function and subscribing it with addEventListener.
The wrapper function is returned for use with `removeEventListener` (or `off`).

<b>IMPORTANT:</b> To remove a listener added with `on`, you must pass in the returned wrapper function as the listener, or use
{{#crossLink "Event/remove"}}{{/crossLink}}. Likewise, each time you call `on` a NEW wrapper function is subscribed, so multiple calls
to `on` with the same params will create multiple listeners.

<h4>Example</h4>

		var listener = myBtn.on("click", handleClick, null, false, {count:3});
		function handleClick(evt, data) {
			data.count -= 1;
			console.log(this == myBtn); // true - scope defaults to the dispatcher
			if (data.count == 0) {
				alert("clicked 3 times!");
				myBtn.off("click", listener);
				// alternately: evt.remove();
			}
		}

Removes all listeners for the specified type, or all listeners of all types.

<h4>Example</h4>

     // Remove all listeners
     displayObject.removeAllEventListeners();

     // Remove all click listeners
     displayObject.removeAllEventListeners("click");

Dispatches the specified event to all listeners.

<h4>Example</h4>

     // Use a string event
     this.dispatchEvent("complete");

     // Use an Event instance
     var event = new createjs.Event("progress");
     this.dispatchEvent(event);

Dispatched each tick. The event will be dispatched to each listener even when the Ticker has been paused using
{{#crossLink "Ticker/setPaused"}}{{/crossLink}}.

<h4>Example</h4>

     createjs.Ticker.addEventListener("tick", handleTick);
     function handleTick(event) {
         console.log("Paused:", event.paused, event.delta);
     }

When the ticker is paused, all listeners will still receive a tick event, but the <code>paused</code> property
of the event will be `true`. Also, while paused the `runTime` will not increase. See {{#crossLink "Ticker/tick:event"}}{{/crossLink}},
{{#crossLink "Ticker/getTime"}}{{/crossLink}}, and {{#crossLink "Ticker/getEventTime"}}{{/crossLink}} for more
info.

<h4>Example</h4>

     createjs.Ticker.addEventListener("tick", handleTick);
     createjs.Ticker.paused = true;
     function handleTick(event) {
         console.log(event.paused,
         	createjs.Ticker.getTime(false),
         	createjs.Ticker.getTime(true));
     }

Prepends the specified matrix to this matrix.
This is the equivalent of multiplying `(specified matrix) * (this matrix)`.
For example, you could calculate the combined transformation for a child object using:

	var o = myDisplayObject;
	var mtx = o.getMatrix();
	while (o = o.parent) {
		// prepend each parent's transformation in turn:
		o.prependMatrix(o.getMatrix());
	}

Generates matrix properties from the specified display object transform properties, and appends them to this matrix.
For example, you can use this to generate a matrix representing the transformations of a display object:

	var mtx = new createjs.Matrix2D();
	mtx.appendTransform(o.x, o.y, o.scaleX, o.scaleY, o.rotation);

Generates matrix properties from the specified display object transform properties, and prepends them to this matrix.
For example, you could calculate the combined transformation for a child object using:

	var o = myDisplayObject;
	var mtx = new createjs.Matrix2D();
	do  {
		// prepend each parent's transformation in turn:
		mtx.prependTransform(o.x, o.y, o.scaleX, o.scaleY, o.rotation, o.skewX, o.skewY, o.regX, o.regY);
	} while (o = o.parent);

	Note that the above example would not account for {{#crossLink "DisplayObject/transformMatrix:property"}}{{/crossLink}}
	values. See {{#crossLink "Matrix2D/prependMatrix"}}{{/crossLink}} for an example that does.

Prepends the specified display properties. This is generally used to apply a parent's properties to a child's.
For example, to get the combined display properties that would be applied to a child, you could use:

	var o = myDisplayObject;
	var props = new createjs.DisplayProps();
	do {
		// prepend each parent's props in turn:
		props.prepend(o.visible, o.alpha, o.shadow, o.compositeOperation, o.getMatrix());
	} while (o = o.parent);

Dispatched when all images are loaded.  Note that this only fires if the images
were not fully loaded when the sprite sheet was initialized. You should check the complete property
to prior to adding a listener. Ex.

	var sheet = new createjs.SpriteSheet(data);
	if (!sheet.complete) {
		// not preloaded, listen for the complete event:
		sheet.addEventListener("complete", handler);
	}

Dispatched when an image encounters an error. A SpriteSheet will dispatch an error event for each image that
encounters an error, and will still dispatch a {{#crossLink "SpriteSheet/complete:event"}}{{/crossLink}}
event once all images are finished processing, even if an error is encountered.

Holds a reference to the last command that was created or appended. For example, you could retain a reference
to a Fill command in order to dynamically update the color later by using:

		var myFill = myGraphics.beginFill("red").command;
		// update color later:
		myFill.style = "yellow";

Returns a CSS compatible color string based on the specified RGB numeric color values in the format
"rgba(255,255,255,1.0)", or if alpha is null then in the format "rgb(255,255,255)". For example,

     createjs.Graphics.getRGB(50, 100, 150, 0.5);
     // Returns "rgba(50,100,150,0.5)"

It also supports passing a single hex color value as the first param, and an optional alpha value as the second
param. For example,

     createjs.Graphics.getRGB(0xFF00FF, 0.2);
     // Returns "rgba(255,0,255,0.2)"

Returns a CSS compatible color string based on the specified HSL numeric color values in the format "hsla(360,100,100,1.0)",
or if alpha is null then in the format "hsl(360,100,100)".

     createjs.Graphics.getHSL(150, 100, 70);
     // Returns "hsl(150,100,70)"

Sets or clears the stroke dash pattern.

	myGraphics.setStrokeDash([20, 10], 0);

A tiny API method `sd` also exists.

Draws a circle with the specified radius at (x, y).

     var g = new createjs.Graphics();
	    g.setStrokeStyle(1);
	    g.beginStroke(createjs.Graphics.getRGB(0,0,0));
	    g.beginFill(createjs.Graphics.getRGB(255,0,0));
	    g.drawCircle(0,0,3);

	    var s = new createjs.Shape(g);
		s.x = 100;
		s.y = 100;

	    stage.addChild(s);
	    stage.update();

A tiny API method "dc" also exists.

Draws a star if pointSize is greater than 0, or a regular polygon if pointSize is 0 with the specified number of
points. For example, the following code will draw a familiar 5 pointed star shape centered at 100, 100 and with a
radius of 50:

     myGraphics.beginFill("#FF0").drawPolyStar(100, 100, 50, 5, 0.6, -90);
     // Note: -90 makes the first point vertical

A tiny API method "dp" also exists.

Appends a graphics command object to the graphics queue. Command objects expose an "exec" method
that accepts two parameters: the Context2D to operate on, and an arbitrary data object passed into
{{#crossLink "Graphics/draw"}}{{/crossLink}}. The latter will usually be the Shape instance that called draw.

This method is used internally by Graphics methods, such as drawCircle, but can also be used directly to insert
built-in or custom graphics commands. For example:

		// attach data to our shape, so we can access it during the draw:
		myShape.color = "red";

		// append a Circle command object:
		myShape.graphics.append(new createjs.Graphics.Circle(50, 50, 30));

		// append a custom command object with an exec method that sets the fill style
		// based on the shape's data, and then fills the circle.
		myShape.graphics.append({exec:function(ctx, shape) {
			ctx.fillStyle = shape.color;
			ctx.fill();
		}});

Stores all graphics commands so they won't be executed in future draws. Calling store() a second time adds to
the existing store. This also affects `drawAsPath()`.

This is useful in cases where you are creating vector graphics in an iterative manner (ex. generative art), so
that only new graphics need to be drawn (which can provide huge performance benefits), but you wish to retain all
of the vector instructions for later use (ex. scaling, modifying, or exporting).

Note that calling store() will force the active path (if any) to be ended in a manner similar to changing
the fill or stroke.

For example, consider a application where the user draws lines with the mouse. As each line segment (or collection of
segments) are added to a Shape, it can be rasterized using {{#crossLink "DisplayObject/updateCache"}}{{/crossLink}},
and then stored, so that it can be redrawn at a different scale when the application is resized, or exported to SVG.

	// set up cache:
	myShape.cache(0,0,500,500,scale);

	// when the user drags, draw a new line:
	myShape.graphics.moveTo(oldX,oldY).lineTo(newX,newY);
	// then draw it into the existing cache:
	myShape.updateCache("source-over");
	// store the new line, so it isn't redrawn next time:
	myShape.store();

	// then, when the window resizes, we can re-render at a different scale:
	// first, unstore all our lines:
	myShape.unstore();
	// then cache using the new scale:
	myShape.cache(0,0,500,500,newScale);
	// finally, store the existing commands again:
	myShape.store();

An array of Filter objects to apply to this display object. Filters are only applied / updated when {{#crossLink "cache"}}{{/crossLink}}
or {{#crossLink "updateCache"}}{{/crossLink}} is called on the display object, and only apply to the area that is
cached.

Redraws the display object to its cache. Calling updateCache without an active cache will throw an error.
If compositeOperation is null the current cache will be cleared prior to drawing. Otherwise the display object
will be drawn over the existing cache using the specified compositeOperation.

<h4>Example</h4>
Clear the current graphics of a cached shape, draw some new instructions, and then update the cache. The new line
will be drawn on top of the old one.

     // Not shown: Creating the shape, and caching it.
     shapeInstance.clear();
     shapeInstance.setStrokeStyle(3).beginStroke("#ff0000").moveTo(100, 100).lineTo(200,200);
     shapeInstance.updateCache();

Transforms the specified x and y position from the coordinate space of the display object
to the global (stage) coordinate space. For example, this could be used to position an HTML label
over a specific point on a nested display object. Returns a Point instance with x and y properties
correlating to the transformed coordinates on the stage.

<h4>Example</h4>

     displayObject.x = 300;
     displayObject.y = 200;
     stage.addChild(displayObject);
     var point = displayObject.localToGlobal(100, 100);
     // Results in x=400, y=300

Transforms the specified x and y position from the global (stage) coordinate space to the
coordinate space of the display object. For example, this could be used to determine
the current mouse position within the display object. Returns a Point instance with x and y properties
correlating to the transformed position in the display object's coordinate space.

<h4>Example</h4>

     displayObject.x = 300;
     displayObject.y = 200;
     stage.addChild(displayObject);
     var point = displayObject.globalToLocal(100, 100);
     // Results in x=-200, y=-100

Transforms the specified x and y position from the coordinate space of this display object to the coordinate
space of the target display object. Returns a Point instance with x and y properties correlating to the
transformed position in the target's coordinate space. Effectively the same as using the following code with
{{#crossLink "DisplayObject/localToGlobal"}}{{/crossLink}} and {{#crossLink "DisplayObject/globalToLocal"}}{{/crossLink}}.

     var pt = this.localToGlobal(x, y);
     pt = target.globalToLocal(pt.x, pt.y);

Tests whether the display object intersects the specified point in <em>local</em> coordinates (ie. draws a pixel
with alpha > 0 at the specified position). This ignores the alpha, shadow, hitArea, mask, and compositeOperation
of the display object.

<h4>Example</h4>

		var myShape = new createjs.Shape();
		myShape.graphics.beginFill("red").drawRect(100, 100, 20, 50);

		console.log(myShape.hitTest(10,10); // false
		console.log(myShape.hitTest(110, 25); // true

Note that to use Stage coordinates (such as {{#crossLink "Stage/mouseX:property"}}{{/crossLink}}), they must
first be converted to local coordinates:

     stage.addEventListener("stagemousedown", handleMouseDown);
     function handleMouseDown(event) {
     	var p = myShape.globalToLocal(stage.mouseX, stage.mouseY);
         var hit = myShape.hitTest(p.x, p.y);
     }

Shape-to-shape collision is not currently supported by EaselJS.

Provides a chainable shortcut method for setting a number of properties on the instance.

<h4>Example</h4>

     var myGraphics = new createjs.Graphics().beginFill("#ff0000").drawCircle(0, 0, 25);
     var shape = stage.addChild(new createjs.Shape()).set({graphics:myGraphics, x:100, y:100, alpha:0.5});

Adds a child to the top of the display list.

<h4>Example</h4>

		container.addChild(bitmapInstance);

You can also add multiple children at once:

		container.addChild(bitmapInstance, shapeInstance, textInstance);

Adds a child to the display list at the specified index, bumping children at equal or greater indexes up one, and
setting its parent to this Container.

<h4>Example</h4>

     addChildAt(child1, index);

You can also add multiple children, such as:

     addChildAt(child1, child2, ..., index);

The index must be between 0 and numChildren. For example, to add myShape under otherShape in the display list,
you could use:

     container.addChildAt(myShape, container.getChildIndex(otherShape));

This would also bump otherShape's index up by one. Fails silently if the index is out of range.

Removes all children from the display list.

<h4>Example</h4>

	container.removeAllChildren();

Returns the child at the specified index.

<h4>Example</h4>

     container.getChildAt(2);

Performs an array sort operation on the child list.

<h4>Example: Display children with a higher y in front.</h4>

     var sortFunction = function(obj1, obj2, options) {
         if (obj1.y > obj2.y) { return 1; }
         if (obj1.y < obj2.y) { return -1; }
         return 0;
     }
     container.sortChildren(sortFunction);

Returns the index of the specified child in the display list, or -1 if it is not in the display list.

<h4>Example</h4>

     var index = container.getChildIndex(child);

Indicates whether the stage should automatically clear the canvas before each render. You can set this to <code>false</code>
to manually control clearing (for generative art, or when pointing multiple stages at the same canvas for
example).

<h4>Example</h4>

     var stage = new createjs.Stage("canvasId");
     stage.autoClear = false;

The canvas the stage will render to. Multiple stages can share a single canvas, but you must disable autoClear for all but the
first stage that will be ticked (or they will clear each other's render).

When changing the canvas property you must disable the events on the old canvas, and enable events on the
new canvas or mouse events will not work as expected. For example:

     myStage.enableDOMEvents(false);
     myStage.canvas = anotherCanvas;
     myStage.enableDOMEvents(true);

If true, mouse move events will continue to be called when the mouse leaves the target canvas. See
{{#crossLink "Stage/mouseInBounds:property"}}{{/crossLink}}, and {{#crossLink "MouseEvent"}}{{/crossLink}}
x/y/rawX/rawY.

Dispatched when the mouse moves from within the canvas area (mouseInBounds == true) to outside it (mouseInBounds == false).
This is currently only dispatched for mouse input (not touch). See the {{#crossLink "MouseEvent"}}{{/crossLink}}
class for a listing of event properties.

Dispatched when the mouse moves into the canvas area (mouseInBounds == false) from outside it (mouseInBounds == true).
This is currently only dispatched for mouse input (not touch). See the {{#crossLink "MouseEvent"}}{{/crossLink}}
class for a listing of event properties.

Each time the update method is called, the stage will call {{#crossLink "Stage/tick"}}{{/crossLink}}
unless {{#crossLink "Stage/tickOnUpdate:property"}}{{/crossLink}} is set to false,
and then render the display list to the canvas.

Propagates a tick event through the display list. This is automatically called by {{#crossLink "Stage/update"}}{{/crossLink}}
unless {{#crossLink "Stage/tickOnUpdate:property"}}{{/crossLink}} is set to false.

If a props object is passed to `tick()`, then all of its properties will be copied to the event object that is
propagated to listeners.

Some time-based features in EaselJS (for example {{#crossLink "Sprite/framerate"}}{{/crossLink}} require that
a {{#crossLink "Ticker/tick:event"}}{{/crossLink}} event object (or equivalent object with a delta property) be
passed as the `props` parameter to `tick()`. For example:

	Ticker.on("tick", handleTick);
	function handleTick(evtObj) {
		// clone the event object from Ticker, and add some custom data to it:
		var evt = evtObj.clone().set({greeting:"hello", name:"world"});

		// pass it to stage.update():
		myStage.update(evt); // subsequently calls tick() with the same param
	}

	// ...
	myDisplayObject.on("tick", handleDisplayObjectTick);
	function handleDisplayObjectTick(evt) {
		console.log(evt.delta); // the delta property from the Ticker tick event object
		console.log(evt.greeting, evt.name); // custom data: "hello world"
	}

Default event handler that calls the Stage {{#crossLink "Stage/update"}}{{/crossLink}} method when a {{#crossLink "DisplayObject/tick:event"}}{{/crossLink}}
event is received. This allows you to register a Stage instance as a event listener on {{#crossLink "Ticker"}}{{/crossLink}}
directly, using:

     Ticker.addEventListener("tick", myStage");

Note that if you subscribe to ticks using this pattern, then the tick event object will be passed through to
display object tick handlers, instead of <code>delta</code> and <code>paused</code> parameters.

Enables or disables (by passing a frequency of 0) mouse over ({{#crossLink "DisplayObject/mouseover:event"}}{{/crossLink}}
and {{#crossLink "DisplayObject/mouseout:event"}}{{/crossLink}}) and roll over events ({{#crossLink "DisplayObject/rollover:event"}}{{/crossLink}}
and {{#crossLink "DisplayObject/rollout:event"}}{{/crossLink}}) for this stage's display list. These events can
be expensive to generate, so they are disabled by default. The frequency of the events can be controlled
independently of mouse move events via the optional `frequency` parameter.

<h4>Example</h4>

     var stage = new createjs.Stage("canvasId");
     stage.enableMouseOver(10); // 10 updates per second

Enables or disables the event listeners that stage adds to DOM elements (window, document and canvas). It is good
practice to disable events when disposing of a Stage instance, otherwise the stage will continue to receive
events from the page.

When changing the canvas property you must disable the events on the old canvas, and enable events on the
new canvas or mouse events will not work as expected. For example:

     myStage.enableDOMEvents(false);
     myStage.canvas = anotherCanvas;
     myStage.enableDOMEvents(true);

Play (unpause) the current animation. The Sprite will be paused if either {{#crossLink "Sprite/stop"}}{{/crossLink}}
or {{#crossLink "Sprite/gotoAndStop"}}{{/crossLink}} is called. Single frame animations will remain
unchanged.

Stop playing a running animation. The Sprite will be playing if {{#crossLink "Sprite/gotoAndPlay"}}{{/crossLink}}
is called. Note that calling {{#crossLink "Sprite/gotoAndPlay"}}{{/crossLink}} or {{#crossLink "Sprite/play"}}{{/crossLink}}
will resume playback.

The TweenJS Timeline that is associated with this MovieClip. This is created automatically when the MovieClip
instance is initialized. Animations are created by adding <a href="http://tweenjs.com">TweenJS</a> Tween
instances to the timeline.

<h4>Example</h4>

     var tween = createjs.Tween.get(target).to({x:0}).to({x:100}, 30);
     var mc = new createjs.MovieClip();
     mc.timeline.addTween(tween);

Elements can be added and removed from the timeline by toggling an "_off" property
using the <code>tweenInstance.to()</code> method. Note that using <code>Tween.set</code> is not recommended to
create MovieClip animations. The following example will toggle the target off on frame 0, and then back on for
frame 1. You can use the "visible" property to achieve the same effect.

     var tween = createjs.Tween.get(target).to({_off:false})
         .wait(1).to({_off:true})
         .wait(1).to({_off:false});

A {{#crossLink "SpriteSheet/framerate:property"}}{{/crossLink}} value that will be passed to new {{#crossLink "SpriteSheet"}}{{/crossLink}} instances that are
created. If no framerate is specified (or it is 0), then SpriteSheets will use the {{#crossLink "Ticker"}}{{/crossLink}}
framerate.

Sets up the prototype chain and constructor property for a new class.

This should be called right after creating the class constructor.

	function MySubClass() {}
	createjs.extend(MySubClass, MySuperClass);
	MySubClass.prototype.doSomething = function() { }

	var foo = new MySubClass();
	console.log(foo instanceof MySuperClass); // true
	console.log(foo.prototype.constructor === MySubClass); // true

Promotes any methods on the super class that were overridden, by creating an alias in the format `prefix_methodName`.
It is recommended to use the super class's name as the prefix.
An alias to the super class's constructor is always added in the format `prefix_constructor`.
This allows the subclass to call super class methods without using `function.call`, providing better performance.

For example, if `MySubClass` extends `MySuperClass`, and both define a `draw` method, then calling `promote(MySubClass, "MySuperClass")`
would add a `MySuperClass_constructor` method to MySubClass and promote the `draw` method on `MySuperClass` to the
prototype of `MySubClass` as `MySuperClass_draw`.

This should be called after the class's prototype is fully defined.

	function ClassA(name) {
		this.name = name;
	}
	ClassA.prototype.greet = function() {
		return "Hello "+this.name;
	}

	function ClassB(name, punctuation) {
		this.ClassA_constructor(name);
		this.punctuation = punctuation;
	}
	createjs.extend(ClassB, ClassA);
	ClassB.prototype.greet = function() {
		return this.ClassA_greet()+this.punctuation;
	}
	createjs.promote(ClassB, "ClassA");

	var foo = new ClassB("World", "!?!");
	console.log(foo.greet()); // Hello World!?!

A function proxy for methods. By default, JavaScript methods do not maintain scope, so passing a method as a
callback will result in the method getting called in the scope of the caller. Using a proxy ensures that the
method gets called in the correct scope.

Additional arguments can be passed that will be applied to the function when it is called.

<h4>Example</h4>

     myObject.addEventListener("event", createjs.proxy(myHandler, this, arg1, arg2));

     function myHandler(arg1, arg2) {
          // This gets called when myObject.myCallback is executed.
     }

Finds the first occurrence of a specified value searchElement in the passed in array, and returns the index of
that value.  Returns -1 if value is not found.

     var i = createjs.indexOf(myArray, myElementToFind);

Causes the active listener to be removed via removeEventListener();

		myBtn.addEventListener("click", function(evt) {
			// do stuff...
			evt.remove(); // removes this listener.
		});

Adds the specified event listener. Note that adding multiple listeners to the same function will result in
multiple callbacks getting fired.

<h4>Example</h4>

     displayObject.addEventListener("click", handleClick);
     function handleClick(event) {
        // Click happened.
     }

A shortcut method for using addEventListener that makes it easier to specify an execution scope, have a listener
only run once, associate arbitrary data with the listener, and remove the listener.

This method works by creating an anonymous wrapper function and subscribing it with addEventListener.
The wrapper function is returned for use with `removeEventListener` (or `off`).

<b>IMPORTANT:</b> To remove a listener added with `on`, you must pass in the returned wrapper function as the listener, or use
{{#crossLink "Event/remove"}}{{/crossLink}}. Likewise, each time you call `on` a NEW wrapper function is subscribed, so multiple calls
to `on` with the same params will create multiple listeners.

<h4>Example</h4>

		var listener = myBtn.on("click", handleClick, null, false, {count:3});
		function handleClick(evt, data) {
			data.count -= 1;
			console.log(this == myBtn); // true - scope defaults to the dispatcher
			if (data.count == 0) {
				alert("clicked 3 times!");
				myBtn.off("click", listener);
				// alternately: evt.remove();
			}
		}

Removes all listeners for the specified type, or all listeners of all types.

<h4>Example</h4>

     // Remove all listeners
     displayObject.removeAllEventListeners();

     // Remove all click listeners
     displayObject.removeAllEventListeners("click");

Dispatches the specified event to all listeners.

<h4>Example</h4>

     // Use a string event
     this.dispatchEvent("complete");

     // Use an Event instance
     var event = new createjs.Event("progress");
     this.dispatchEvent(event);

Provides a chainable shortcut method for setting a number of properties on the instance.

<h4>Example</h4>

     var loadItem = new createjs.LoadItem().set({src:"image.png", maintainOrder:true});

Determine if the loader was canceled. Canceled loads will not fire complete events. Note that this property
is readonly, so {{#crossLink "LoadQueue"}}{{/crossLink}} queues should be closed using {{#crossLink "LoadQueue/close"}}{{/crossLink}}
instead.

The current load progress (percentage) for this item. This will be a number between 0 and 1.

<h4>Example</h4>

    var queue = new createjs.LoadQueue();
    queue.loadFile("largeImage.png");
    queue.on("progress", function() {
        console.log("Progress:", queue.progress, event.progress);
    });

A formatter function that converts the loaded raw result into the final result. For example, the JSONLoader
converts a string of text into a JavaScript object. Not all loaders have a resultFormatter, and this property
can be overridden to provide custom formatting.

Optionally, a resultFormatter can return a callback function in cases where the formatting needs to be
asynchronous, such as creating a new image. The callback function is passed 2 parameters, which are callbacks
to handle success and error conditions in the resultFormatter. Note that the resultFormatter method is
called in the current scope, as well as the success and error callbacks.

<h4>Example asynchronous resultFormatter</h4>

	function _formatResult(loader) {
		return function(success, error) {
			if (errorCondition) { error(errorDetailEvent); }
			success(result);
		}
	}

params.description:
The file item which was specified in the {{#crossLink "LoadQueue/loadFile"}}{{/crossLink}}
or {{#crossLink "LoadQueue/loadManifest"}}{{/crossLink}} call. If only a string path or tag was specified, the
object will contain that value as a `src` property.

classitems.description:
Begin loading the item. This method is required when using a loader by itself.

<h4>Example</h4>

     var queue = new createjs.LoadQueue();
     queue.on("complete", handleComplete);
     queue.loadManifest(fileArray, false); // Note the 2nd argument that tells the queue not to start loading yet
     queue.load();

An object hash of callbacks that are fired for each file type before the file is loaded, giving plugins the
ability to override properties of the load. Please see the {{#crossLink "LoadQueue/installPlugin"}}{{/crossLink}}
method for more information.

An object hash of callbacks that are fired for each file extension before the file is loaded, giving plugins the
ability to override properties of the load. Please see the {{#crossLink "LoadQueue/installPlugin"}}{{/crossLink}}
method for more information.

params.description:
